2017 Sydney Learning Festival - Year 4 through to Year 8
Monday 25 - Tuesday 26 September
Join us for two days of fantastic workshops and holiday fun!
Dear {!Lead.FirstName}
Holidays are almost upon us which means it’s also time for the Sydney Learning Festival! We would be delighted for your child to join us as we host students in Year 4 to Year 8 from all over Sydney to this tool-tinkering, discussion-starting festival on Monday 25 and Tuesday 26 September.
Design your own program by choosing the workshops you want to do! There’s something for everyone so bring a friend and get involved in an array of fun and exciting activities including:
· Exploding science;
· Dancemania;
· Web design;
· App smashing;
· Special effects;
· Sushi making;
· Soccer skills; and
· Much, much more!
Bookings essential. View the full Festival program and book a Festival pass today at www.sydneylearningfestival.com.au.
The Festival features Grace Partridge (OA 2010), a versatile artist who works in drama, music and visual arts. Students will also hear from Trystan Go, currently in Year 10 at St Andrew’s. Trystan is a young stage and screen actor known for his role in the Matchbox and NBC Universal television production ‘The Family Law’ as the principal character Benjamin Law
In the meantime, check out our newly launched video on our homepage www.sydneylearningfestival.com.au or on Facebook https://www.facebook.com/sydneylearningfestival/ where we will be posting more updates over the coming weeks.
Regards
Bruce Perry Registrar/Mathematics Teacher
